import React from 'react';
import Item from './Item';

class App extends React.Component {
    render() {
        var data = [
            { name: 'Milk' },
            { name: 'Bread' },
        ]

        return (
            <ul>
                {data.map( v => <Item name={v.name} />)}
            </ul>
        )
    }
}

export default App;
